import gourp1 from '../assets/icon/rectangle/Group16.png'
import gourp2 from '../assets/icon/rectangle/Group17.png'
import gourp3 from '../assets/icon/rectangle/Group18.png'
import rectangle1 from '../assets/img/rectangle/Rectangle8.png' 
import rectangle2 from '../assets/img/rectangle/Rectangle9.png' 
import rectangle3 from '../assets/img/rectangle/Rectangle10.png' 
import rectangle4 from '../assets/img/rectangle/Rectangle11.png' 

const Rectangle = [
    {
        rightText: [
            {
                title: [
                    {
                        id: 0,
                        text: 'наше предложение'
                    },
                    {
                        id: 1,
                        text: 'Лучшие программы для тебя'
                    },
                ],
                TopText: [
                    {
                        id: 0,
                        text: 'Его корни уходят в один фрагмент классической латыни 45 года н.э., то есть более двух тысячелетий назад. Ричард МакКлинток, профессор латыни из колледжа.'
                    }
                ]
            }
        ],
        rectangleText: [
            {
                id: 0,
                img: gourp1,
                title: 'Опытный гид',
                textLorem: 'Для современного мира базовый вектор развития предполагает независимые способы реализации соответствующих условий активизации.'
            },
            {
                id: 1,
                img: gourp2,
                title: 'Безопасный поход',
                textLorem: 'Для современного мира базовый вектор развития предполагает независимые способы реализации соответствующих условий активизации.'
            },
            {
                id: 2,
                img: gourp3,
                title: 'Лояльные цены',
                textLorem: 'Для современного мира базовый вектор развития предполагает независимые способы реализации соответствующих условий активизации.'
            }
        ],
        buttonText: [
            {
                id: 0,
                text: 'Стоимость программ'
            }
        ],
        leftImg: [
            {
                id: 0,
                img: rectangle1,
            },
            {
                id: 1,
                img: rectangle2,
            },
            {
                id: 2,
                img: rectangle3,
            },
            {
                id: 3,
                img: rectangle4
            },
        ]
    }
]
export default Rectangle
